import React from 'react';
import {useInput} from "../hooks/useInput";
const Step1: React.FC = () => {
    const [ name, onChangeHandler ] = useInput("");

    return (
        <div>
           <form>
               <input type={'text'} value={name} onChange={onChangeHandler}/>
           </form>
        </div>
    );
};

export default Step1;
